import React from 'react';
import Link from 'next/link';
import './styles.scss';

export default function Home() {
  function handleRoute() {
    <Link href="/login">
      <a>Login</a>
    </Link>
  }
  return (
      <div className="container">
        <h1>Welcome to TransportWise</h1>
        <p>Let's discuss transport</p>
        <br />
        <button type="button" className="btn" onClick={handleRoute}>Login</button>
        <br /> <br />
        <button type="button" className="btn2" onClick={handleRoute}>Register</button>
      </div>
  );
}
